import {
  ILayoutRestorer,
  JupyterFrontEnd,
  JupyterFrontEndPlugin
} from '@jupyterlab/application';

import { ILauncher } from '@jupyterlab/launcher';

import {
  ICommandPalette,
  MainAreaWidget,
  WidgetTracker,
} from '@jupyterlab/apputils';

import { CounterWidget } from './widget';

async function activate(
  app: JupyterFrontEnd,
  palette: ICommandPalette,
  launcher: ILauncher,
  restorer: ILayoutRestorer | null,
) {
    console.log('JupyterLab extension ResearchBuddy is activated!');
    let widget: MainAreaWidget<CounterWidget>;

    // Add an application command
    const command: string = 'rndbd:open';
    app.commands.addCommand(command, {
      label: 'Research Buddy',
      // icon: aiIcon,
      execute: async () => {
        // Regenerate the widget if disposed
        if (!widget || widget.isDisposed) {
          const content = new CounterWidget()
          widget = new MainAreaWidget({ content });
          widget.id = 'rndbd-jupyterlab';
          widget.title.label = 'Research Buddy';
          widget.title.closable = true;
        }
        if (!tracker.has(widget)) {
          tracker.add(widget);
        }
        if (!widget.isAttached) {
          // Attach the widget to the main work area if it's not there
          app.shell.add(widget, 'main');
        }
        // Activate the widget
        app.shell.activateById(widget.id);
      }
    });

    // Add the command to the palette.
    palette.addItem({ command, category: 'Tutorial' });
    launcher.add({
      command: command,
      category: 'Notebook',
      // eslint-disable-next-line max-len
      kernelIconUrl: "data:image/png;base64,",
      rank: 0
    });
    app.contextMenu.addItem({
      command: command,
      selector: '.jp-Notebook'
    })
    app.commands.addKeyBinding({
      command: command,
      args: {},
      keys: ['Accel K'],
      selector: '.jp-Notebook'
    });
    let tracker = new WidgetTracker<MainAreaWidget<CounterWidget>>({
      namespace: 'rndbd'
    });
    if (restorer) {
      restorer.restore(tracker, {
        command,
        name: () => 'rndbd',
      })
    }

}

/**
 * Initialization data for the ResearchBuddy extension.
 */
const plugin: JupyterFrontEndPlugin<void> = {
  id: 'ResearchBuddy:plugin',
  description: 'An Intelligent Research Buddy',
  autoStart: true,
  requires: [ICommandPalette, ILauncher],
  optional: [ILayoutRestorer],
  activate: activate
};

export default plugin;

